INSERT INTO `perfil_tatuador` (`id`, `idusuario`, `estilo`, `descricao`, `imagem`, `instagram`, `portifolio_url`) VALUES
(1, 1, 'blackwork', 'Há 5 anos transformo ideias e sentimentos em tatuagens que contam histórias. Sou apaixonada por blackwork e adoro trabalhar em projetos que me desafiam a criar algo único para cada pessoa.\r\nMeu objetivo é garantir que cada sessão seja uma experiência descontraída e, claro, que você saia com uma tattoo que vai amar para sempre. Dá uma olhada no meu portfólio aí embaixo e, se curtir meu trabalho, bora marcar uma sessão? Vai ser um prazer criar algo especial pra você!', '/images/fulana.png', '@fulanatattoo', 'https://www.instagram.com/fulanatattoo'),
(2, 2, 'realista', 'Tatuo há mais de 8 anos e sou completamente fascinado pelo estilo realista. Curto transformar fotos, ideias ou lembranças marcantes em artes que parecem saltar da pele. Cada projeto é pensado nos mínimos detalhes, com foco em capturar a essência da pessoa e da imagem. Se você quer uma tattoo com impacto visual e significado, dá uma conferida no meu portfólio e me chama! Vai ser massa criar algo inesquecível pra você.', '/images/fulano.png', 'https://instagram.com/fulano', 'https://portifolio.com/fulano'),
(3, 3, 'oldschool', 'Sou tatuadora há 6 anos e tenho o coração batendo forte pelo estilo oldschool. Gosto de linhas marcadas, cores vibrantes e aquela pegada clássica que nunca sai de moda. Adoro quando o cliente traz uma ideia e a gente constrói junto uma tattoo cheia de personalidade. Confere meu portfólio aqui embaixo e, se curtir o estilo, bora bater um papo e marcar aquela sessão estilosa!', '/images/joaquina.png', 'https://instagram.com/joaquina', 'https://portifolio.com/joaquina'),
(4, 4, 'oriental', 'Há mais de 10 anos mergulho na arte da tatuagem oriental, sempre buscando respeitar as raízes desse estilo tão rico em simbolismo e tradição. Curto trabalhar em projetos maiores, com composições que contam histórias profundas e visualmente impactantes. Se você tem uma ideia com significado e quer transformar isso numa obra de arte, dá uma olhada no meu portfólio. Vai ser um prazer dar vida a isso com você.', '/images/jose.png', 'https://instagram.com/joseze', 'https://portifolio.com/joseze'),
(5, 5, 'anime/geek', 'Sou nerd assumido e tatuador há 12 anos, unindo duas paixões: arte e cultura geek. Curto demais transformar personagens, cenas de anime, games e HQs em tattoos cheias de estilo e emoção. Cada traço é feito com carinho pra quem vibra com esse universo tanto quanto eu. Se você quer levar sua paixão na pele, confere meu portfólio e bora trocar ideia. Vai ser épico fazer parte da sua jornada geek!', '/images/francisquinho.png', 'https://instagram.com/francisquinho', 'https://portifolio.com/francisquinho');

